# 9) Display all 7501 records with valid products names only (remove all NaN values from all the records.)

transactions = []
for i in range(0,7501):
    transactions.append([str(df.iloc[i,j]) for j in range(0,20) if str(df.iloc[i,j])!='nan'])

df.iloc[0:5]

transactions[0:5]

from apyori import apriori

rules = apriori(transactions,min_support=0.003,min_confidence=0.3,min_lift=2,max_length=2)

rules_list = list(rules)

rules_list

results = pd.DataFrame(columns = ["Items base", "Item added", "confidence","Lift"])

results

for i in range(0,len(rules_list)):
  item_base = rules[i].ordered_statistics[0].items_base
  item_added = rules[i].ordered_statistics[0].items_add
  confidence = rules[i].ordered_statistics[0].confidence
  lift = rules_list.ordered_statistics[0].lift
  results.loc[i] = [item_base,item_added,confidence,lift]

results[results["Lift"] > 2.5]

